interface Command {
  execute(): void;
}

// \u5177\u4F53\u547D\u4EE4\u7C7BA
class ConcreteCommandA implements Command {
  private receiver: Receiver;

  constructor(receiver: Receiver) {
    this.receiver = receiver;
  }

  public execute() {
    this.receiver.actionA();
  }
}

// \u5177\u4F53\u547D\u4EE4\u7C7BB
class ConcreteCommandB implements Command {
  private receiver: Receiver;

  constructor(receiver: Receiver) {
    this.receiver = receiver;
  }

  public execute() {
    this.receiver.actionB();
  }
}

// \u63A5\u6536\u8005\u7C7B
class Receiver {
  public actionA() {
    console.log("Receiver: Action A");
  }

  public actionB() {
    console.log("Receiver: Action B");
  }
}

// \u8C03\u7528\u8005\u7C7B
class Invoker {
  private onStart: Command;
  private onFinish: Command;

  constructor(onStart: Command, onFinish: Command) {
    this.onStart = onStart;
    this.onFinish = onFinish;
  }

  public doSomethingImportant() {
    console.log("Invoker: Do something important");
    this.onStart.execute();
    console.log("Invoker: Continue doing something important");
    this.onFinish.execute();
  }
}

// \u4F7F\u7528\u793A\u4F8B
const receiver = new Receiver(); // \u521B\u5EFA\u63A5\u6536\u8005\u7C7B\u5B9E\u4F8B
const commandA = new ConcreteCommandA(receiver); // \u521B\u5EFA\u5177\u4F53\u547D\u4EE4\u7C7BA\u5B9E\u4F8B\uFF0C\u5E76\u4F20\u5165\u63A5\u6536\u8005\u7C7B\u5B9E\u4F8B
const commandB = new ConcreteCommandB(receiver); // \u521B\u5EFA\u5177\u4F53\u547D\u4EE4\u7C7BB\u5B9E\u4F8B\uFF0C\u5E76\u4F20\u5165\u63A5\u6536\u8005\u7C7B\u5B9E\u4F8B
const invoker = new Invoker(commandA, commandB); // \u521B\u5EFA\u8C03\u7528\u8005\u7C7B\u5B9E\u4F8B\uFF0C\u5E76\u4F20\u5165\u5177\u4F53\u547D\u4EE4\u7C7BA\u548CB\u5B9E\u4F8B

invoker.doSomethingImportant(); // \u8C03\u7528\u8C03\u7528\u8005\u7C7B\u7684doSomethingImportant\u65B9\u6CD5\uFF0C\u8F93\u51FA\uFF1AInvoker: Do something important\\nReceiver: Action A\\nInvoker: Continue doing something important\\nReceiver: Action B
`,paraId:2,tocIndex:3},{value:"\u4E2D\u4ECB\u8005\u6A21\u5F0F\u5305\u542B\u5982\u4E0B\u89D2\u8272\uFF1A",paraId:3,tocIndex:5},{value:"Mediator: \u62BD\u8C61\u4E2D\u4ECB\u8005",paraId:4,tocIndex:5},{value:"ConcreteMediator: \u5177\u4F53\u4E2D\u4ECB\u8005",paraId:4,tocIndex:5},{value:"Colleague: \u62BD\u8C61\u540C\u4E8B\u7C7B",paraId:4,tocIndex:5},{value:"ConcreteColleague: \u5177\u4F53\u540C\u4E8B\u7C7B",paraId:4,tocIndex:5},{value:`// \u62BD\u8C61\u4E2D\u4ECB\u8005\u7C7B
abstract class Mediator {
  public abstract notify(sender: object, event: string): void;
}

// \u5177\u4F53\u4E2D\u4ECB\u8005\u7C7B
class ConcreteMediator extends Mediator {
  private component1: Component1;
  private component2: Component2;

  constructor(component1: Component1, component2: Component2) {
    super();
    this.component1 = component1;
    this.component1.setMediator(this);
    this.component2 = component2;
    this.component2.setMediator(this);
  }

  // \u5B9E\u73B0\u4E2D\u4ECB\u8005\u7C7B\u7684\u901A\u77E5\u65B9\u6CD5
  public notify(sender: object, event: string): void {
    if (event === "A") {
      console.log("Mediator reacts on A and triggers following operations:");
      this.component2.doC();
    }

    if (event === "D") {
      console.log("Mediator reacts on D and triggers following operations:");
      this.component1.doB();
      this.component2.doC();
    }
  }
}

// \u62BD\u8C61\u7EC4\u4EF6\u7C7B
class BaseComponent {
  protected mediator: Mediator;

  constructor(mediator: Mediator = null) {
    this.mediator = mediator;
  }

  public setMediator(mediator: Mediator): void {
    this.mediator = mediator;
  }
}

// \u5177\u4F53\u7EC4\u4EF6\u7C7B1
class Component1 extends BaseComponent {
  public doA(): void {
    console.log("Component 1 does A.");
    this.mediator.notify(this, "A");
  }

  public doB(): void {
    console.log("Component 1 does B.");
    this.mediator.notify(this, "B");
  }
}

// \u5177\u4F53\u7EC4\u4EF6\u7C7B2
class Component2 extends BaseComponent {
  public doC(): void {
    console.log("Component 2 does C.");
    this.mediator.notify(this, "C");
  }

  public doD(): void {
    console.log("Component 2 does D.");
    this.mediator.notify(this, "D");
  }
}

// \u4F7F\u7528\u793A\u4F8B
const component1 = new Component1(); // \u521B\u5EFA\u5177\u4F53\u7EC4\u4EF6\u7C7B1\u5B9E\u4F8B
const component2 = new Component2(); // \u521B\u5EFA\u5177\u4F53\u7EC4\u4EF6\u7C7B2\u5B9E\u4F8B
const mediator = new ConcreteMediator(component1, component2); // \u521B\u5EFA\u5177\u4F53\u4E2D\u4ECB\u8005\u7C7B\u5B9E\u4F8B\uFF0C\u5E76\u4F20\u5165\u5177\u4F53\u7EC4\u4EF6\u7C7B1\u548C2\u5B9E\u4F8B

console.log("Client triggers operation A.");
component1.doA(); // \u8C03\u7528\u5177\u4F53\u7EC4\u4EF6\u7C7B1\u7684doA\u65B9\u6CD5\uFF0C\u8F93\u51FA\uFF1AComponent 1 does A.\\nMediator reacts on A and triggers following operations:\\nComponent 2 does C.

console.log("\\nClient triggers operation D.");
component2.doD(); // \u8C03\u7528\u5177\u4F53\u7EC4\u4EF6\u7C7B2\u7684doD\u65B9\u6CD5\uFF0C\u8F93\u51FA\uFF1AComponent 2 does D.\\nMediator reacts on D and triggers following operations:\\nComponent 1 does B.\\nComponent 2 does C.
`,paraId:5,tocIndex:6},{value:"\u89C2\u5BDF\u8005\u6A21\u5F0F\u5305\u542B\u5982\u4E0B\u89D2\u8272\uFF1A",paraId:6,tocIndex:8},{value:"Subject: \u76EE\u6807",paraId:7,tocIndex:8},{value:"ConcreteSubject: \u5177\u4F53\u76EE\u6807",paraId:7,tocIndex:8},{value:"Observer: \u89C2\u5BDF\u8005",paraId:7,tocIndex:8},{value:"ConcreteObserver: \u5177\u4F53\u89C2\u5BDF\u8005",paraId:7,tocIndex:8},{value:`// \u4E3B\u9898\u63A5\u53E3
interface Subject {
  attach(observer: Observer): void; // \u6DFB\u52A0\u89C2\u5BDF\u8005
  detach(observer: Observer): void; // \u79FB\u9664\u89C2\u5BDF\u8005
  notify(): void; // \u901A\u77E5\u6240\u6709\u89C2\u5BDF\u8005
}

// \u5177\u4F53\u4E3B\u9898\u7C7B
class ConcreteSubject implements Subject {
  private observers: Observer[] = [];

  public attach(observer: Observer) {
    const isExist = this.observers.includes(observer);
    if (isExist) {
      console.log("Subject: Observer has been attached already.");
      return;
    }

    console.log("Subject: Attached an observer.");
    this.observers.push(observer);
  }

  public detach(observer: Observer) {
    const observerIndex = this.observers.indexOf(observer);
    if (observerIndex === -1) {
      console.log("Subject: Nonexistent observer.");
      return;
    }

    console.log("Subject: Detached an observer.");
    this.observers.splice(observerIndex, 1);
  }

  public notify() {
    console.log("Subject: Notifying observers...");
    for (const observer of this.observers) {
      observer.update(this);
    }
  }

  public someBusinessLogic() {
    console.log("\\nSubject: I'm doing something important.");
    this.notify();
  }
}

// \u89C2\u5BDF\u8005\u63A5\u53E3
interface Observer {
  update(subject: Subject): void; // \u63A5\u6536\u4E3B\u9898\u901A\u77E5
}

// \u5177\u4F53\u89C2\u5BDF\u8005\u7C7BA
class ConcreteObserverA implements Observer {
  public update(subject: Subject) {
    if (subject instanceof ConcreteSubject) {
      console.log("ConcreteObserverA: Reacted to the event.");
    }
  }
}

// \u5177\u4F53\u89C2\u5BDF\u8005\u7C7BB
class ConcreteObserverB implements Observer {
  public update(subject: Subject) {
    if (subject instanceof ConcreteSubject) {
      console.log("ConcreteObserverB: Reacted to the event.");
    }
  }
}

// \u4F7F\u7528\u793A\u4F8B
const subject = new ConcreteSubject(); // \u521B\u5EFA\u5177\u4F53\u4E3B\u9898\u7C7B\u5B9E\u4F8B
`,paraId:8,tocIndex:9},{value:"\u72B6\u6001\u6A21\u5F0F\u5305\u542B\u5982\u4E0B\u89D2\u8272\uFF1A",paraId:9,tocIndex:11},{value:"Context: \u73AF\u5883\u7C7B",paraId:10,tocIndex:11},{value:"State: \u62BD\u8C61\u72B6\u6001\u7C7B",paraId:10,tocIndex:11},{value:"ConcreteState: \u5177\u4F53\u72B6\u6001\u7C7B",paraId:10,tocIndex:11},{value:`// \u62BD\u8C61\u72B6\u6001\u7C7B
interface State {
  handle(context: Context): void;
}

// \u5177\u4F53\u72B6\u6001\u7C7BA
class ConcreteStateA implements State {
  public handle(context: Context) {
    console.log("ConcreteStateA handles the request.");
    context.state = new ConcreteStateB();
  }
}

// \u5177\u4F53\u72B6\u6001\u7C7BB
class ConcreteStateB implements State {
  public handle(context: Context) {
    console.log("ConcreteStateB handles the request.");
    context.state = new ConcreteStateA();
  }
}

// \u4E0A\u4E0B\u6587\u7C7B
class Context {
  private _state: State;

  constructor(state: State) {
    this._state = state;
  }

  // \u5B9A\u4E49\u4E00\u4E2A\u8BF7\u6C42\u5904\u7406\u65B9\u6CD5\uFF0C\u59D4\u6258\u7ED9\u5F53\u524D\u72B6\u6001\u5BF9\u8C61\u6765\u5904\u7406
  public request() {
    this._state.handle(this);
  }

  // \u5B9A\u4E49\u4E00\u4E2A\u72B6\u6001\u5C5E\u6027\uFF0C\u7528\u4E8E\u4FDD\u5B58\u5F53\u524D\u72B6\u6001\u5BF9\u8C61
  public get state(): State {
    return this._state;
  }

  public set state(state: State) {
    this._state = state;
  }
}

// \u4F7F\u7528\u793A\u4F8B
const context = new Context(new ConcreteStateA()); // \u521B\u5EFA\u4E0A\u4E0B\u6587\u5B9E\u4F8B\uFF0C\u5E76\u4F20\u5165\u5177\u4F53\u72B6\u6001\u7C7BA\u5B9E\u4F8B
context.request(); // \u8C03\u7528\u4E0A\u4E0B\u6587\u7684\u8BF7\u6C42\u5904\u7406\u65B9\u6CD5\uFF0C\u8F93\u51FA\uFF1AConcreteStateA handles the request.
context.request(); // \u518D\u6B21\u8C03\u7528\u4E0A\u4E0B\u6587\u7684\u8BF7\u6C42\u5904\u7406\u65B9\u6CD5\uFF0C\u8F93\u51FA\uFF1AConcreteStateB handles the request.
`,paraId:11,tocIndex:12},{value:"\u7B56\u7565\u6A21\u5F0F\u5305\u542B\u5982\u4E0B\u89D2\u8272\uFF1A",paraId:12,tocIndex:14},{value:"Context: \u73AF\u5883\u7C7B",paraId:13,tocIndex:14},{value:"Strategy: \u62BD\u8C61\u7B56\u7565\u7C7B",paraId:13,tocIndex:14},{value:"ConcreteStrategy: \u5177\u4F53\u7B56\u7565\u7C7B",paraId:13,tocIndex:14},{value:`// \u7B56\u7565\u63A5\u53E3
interface Strategy {
  doAlgorithm(data: string[]): string[];
}

// \u5177\u4F53\u7B56\u7565\u7C7BA
class ConcreteStrategyA implements Strategy {
  public doAlgorithm(data: string[]): string[] {
    return data.sort();
  }
}

// \u5177\u4F53\u7B56\u7565\u7C7BB
class ConcreteStrategyB implements Strategy {
  public doAlgorithm(data: string[]): string[] {
    return data.reverse();
  }
}

// \u73AF\u5883\u7C7B
class Context {
  private strategy: Strategy;

  constructor(strategy: Strategy) {
    this.strategy = strategy;
  }

  // \u8BBE\u7F6E\u7B56\u7565
  public setStrategy(strategy: Strategy) {
    this.strategy = strategy;
  }

  // \u6267\u884C\u7B56\u7565
  public doSomeBusinessLogic(data: string[]): string[] {
    const result = this.strategy.doAlgorithm(data);
    return result;
  }
}

// \u4F7F\u7528\u793A\u4F8B
const context = new Context(new ConcreteStrategyA()); // \u521B\u5EFA\u73AF\u5883\u7C7B\u5B9E\u4F8B\uFF0C\u5E76\u4F20\u5165\u5177\u4F53\u7B56\u7565\u7C7BA\u5B9E\u4F8B
const data = ["a", "b", "c", "d", "e"]; // \u521B\u5EFA\u6570\u636E
console.log("Client: Strategy is set to normal sorting.");
console.log(context.doSomeBusinessLogic(data).join(",")); // \u8C03\u7528\u73AF\u5883\u7C7B\u7684\u65B9\u6CD5\uFF0C\u8F93\u51FA\uFF1Aa,b,c,d,e

console.log("\\nClient: Strategy is set to reverse sorting.");
context.setStrategy(new ConcreteStrategyB()); // \u8BBE\u7F6E\u5177\u4F53\u7B56\u7565\u7C7BB\u5B9E\u4F8B
console.log(context.doSomeBusinessLogic(data).join(",")); // \u8C03\u7528\u73AF\u5883\u7C7B\u7684\u65B9\u6CD5\uFF0C\u8F93\u51FA\uFF1Ae,d,c,b,a
